'use strict';

angular.module('product').controller('ReviewProductController', ['$scope', '$rootScope', '$http', '$window', '$stateParams', 'config', 'DateTimeService', 'Note', 'Product', '$validation', 'toaster', '$upload', 'DocumentService', function ($scope, $rootScope, $http, $window, $stateParams, config, DateTimeService, Note, Product, $validation, toaster, $upload, DocumentService) {

    var ProductResource = Product.resource;
    var NoteResource = Note.resource;
    var documentResource            = DocumentService.resource;

    var id = (!_.isUndefined($stateParams.id)) ? $stateParams.id : null;
    if(id != null){
        $scope.product = ProductResource.get({id: id}, function(product){
            $scope.product = product;
        });
        $scope.notes = NoteResource.findAll({product: id, page: 1});
        if(_.isUndefined($scope.product.documents))
            $scope.product.documents = [];
    }

    $scope.note = {
        description: null
    };

    $scope.save = function() {
        $validation.validate($scope, 'note').success(function() {
            var note         = new NoteResource();
            note.description = $scope.note.description;
            note.product = {id: $scope.product.id};

            note.$save({}, function(response) {
                $scope.notes.push(response);
                toaster.pop('success', 'Note Created', 'You have successfully created a new note.');
            }, function() {
                toaster.pop('error', 'Error', 'Something went wrong a new Note could not be created');
            });
            $scope.note.description = null;
        }).error(function() {
            toaster.pop('error', 'Error', 'Complete the required entry fields.');
        });
    };

    $scope.onFileSelect = function($files) {
        for (var i = 0; i < $files.length; i++) {
            var file = $files[i];
            $scope.upload = $upload.upload({
                url: config.api.baseUrl + '/documents',
                data: {
                    organization:   {id: config.application.organizationId},
                    documentType:   'GENERAL'
                },
                file: file
            }).progress(function(evt) {
                console.log('percent: ' + parseInt(100.0 * evt.loaded / evt.total));
            }).success(function(data, status, headers, config) {
                if(data.id) {
                    $scope.product.documents.push(data);
                    $scope.product.$update({id: $scope.product.id}, function(response) {
                        $rootScope.$broadcast('product::updated');
                        toaster.pop('success', 'Document Uploaded', 'You have been successfully uploaded a new document.')
                    });
                }
            }).error(function() {
                toaster.pop('error', 'Document Upload', 'An error ocurred while trying to upload the selected document. Please try again.');
            });
        }
    };

    $scope.deleteDocument = function(document) {
        documentResource.delete({id: document.id}, function(){
            var index = $scope.product.documents.indexOf(document);
            $scope.product.documents.splice(index, 1);
        }, function() {
            toaster.pop('error', 'Document Removal', 'An error ocurred while trying to remove this document. Please try again.');
        });
    };

    $scope.downloadDocument = function(document) {
        $http({
            method: 'GET',
            url: config.api.baseUrl + '/documents/base64/' + document.id + '/' + config.application.organizationId,
        }).success(function(response) {
            $window.open("data:" + response.type + ";base64, " + response.base64, document.name);
        });
    }
    $scope.type = "image/jpeg";
    $scope.base64 = "";

    $scope.showDocument = function(document) {
        $http({
            method: 'GET',
            url: config.api.baseUrl + '/documents/base64/' + document.id + '/' + config.application.organizationId,
        }).success(function(response) {

            return "data:" + response.type + ";base64, " + response.base64;
        });
    }

}]);